import Item from './Item';
import { Event } from '../models/event';

interface Props {
    events: Array<Event>;
    id: number;
    description: string;
    date: string;
    onDelete:(id: number) => void;
    onSearch?:string;
}

const Events: React.FC<Props> = ({events, onDelete, onSearch}) => {

    return (
        <>
        <h1>Event list: </h1>

        {events.map((event, index) => {

                <Item 
                        key={event.id}
                        id={event.id}
                        description={event.description}
                        date={event.date} 
                        events={[]}
                        onDelete={onDelete}        
                    />
            })
        }
        </>
    )}



export default Events
